import React, { useState, useEffect } from 'react';
import './Tracker.css'; // External CSS file for styling

const Tracker = () => {
  const [foodLabel, setFoodLabel] = useState('Breakfast Time:');
  const [sleepLabel, setSleepLabel] = useState('Bedtime:');

  useEffect(() => {
    const currentTime = new Date().getHours();

    if (currentTime >= 0 && currentTime < 12) {
      setFoodLabel('Breakfast Time:');
      setSleepLabel('Wake Up Time:');
    } else if (currentTime >= 12 && currentTime < 18) {
      setFoodLabel('Lunch Time:');
      setSleepLabel('Afternoon Nap Time:');
    } else {
      setFoodLabel('Dinner Time:');
      setSleepLabel('Bedtime:');
    }
  }, []);

  const [foodTime, setFoodTime] = useState('');
  const [sleepTime, setSleepTime] = useState('');

  const handleFoodChange = (event) => {
    setFoodTime(event.target.value);
  };

  const handleSleepChange = (event) => {
    setSleepTime(event.target.value);
  };

  return (
    <div className="tracker-container">
      <h2>Food and Sleep Cycle Tracker</h2>
      <div className="input-container">
        <label htmlFor="food-time">{foodLabel}</label>
        <input
          type="text"
          id="food-time"
          value={foodTime}
          onChange={handleFoodChange}
          placeholder="Enter food time"
        />
      </div>
      <div className="input-container">
        <label htmlFor="sleep-time">{sleepLabel}</label>
        <input
          type="text"
          id="sleep-time"
          value={sleepTime}
          onChange={handleSleepChange}
          placeholder="Enter sleep time"
        />
      </div>
      <div className="info-container">
        <p>Food Time: {foodTime}</p>
        <p>Sleep Time: {sleepTime}</p>
      </div>
    </div>
  );
};

export default Tracker;
